commits.content:
dashboard {
    padding: 20px;
    font-family: Arial, sans-serif;
  }

  .dashboard-header {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 20px;
  }

  .user-profile,
  .account-settings,
  .product-preview,
  .sales-records {
    margin-bottom: 30px;
  }

  .profile-picture img {
    width: 100px;
    height: 100px;
    border-radius: 50%;
    object-fit: cover;
  }

  .upload-input {
    margin-top: 10px;
  }

  .product-list {
    list-style: none;
    padding: 0;
  }

  .product-item {
    border: 1px solid #ddd;
    padding: 10px;
    margin-bottom: 10px;
    border-radius: 5px;
  }

  .sales-table {
    width: 100%;
    border-collapse: collapse;
  }

  .sales-table th,
  .sales-table td {
    border: 1px solid #ddd;
    padding: 8px;
    text-align: left;
  }

  .sales-table th {
    background-color: #f4f4f4;
  }

  button {
    padding: 8px 16px;
    background-color: #007bff;
    color: white;
    border: none;
    border-radius: 4px;
    cursor: pointer;
  }

  button:hover {
    background-color: #0056b3;
  }
